import React from "react";

// Si la imagen está en el directorio de assets o similar, debes importarla.
// Importar una imagen local:
import logo from "../assets/images/logo empresa.png"; // Asegúrate de que la ruta sea correcta

const Navbar = () => {
  return (
    <>
      {/* Cabecera (Logo y menú de navegación) */}
      <header className="main-header">
        <div className="content-wrapper">
          <a href="/">
            {/* Si la imagen se importa con import logo */}
            <img src={logo} alt="Logo de agencia" />
          </a>

          {/* menu hamburguesa */}
          <span id="open-menu-button" className="jam jam-menu"></span>
          <nav id="main-menu" className="main-menu">
            <span id="close-menu-button" className="jam jam-close"></span>

            <ul>
              <li>
                <a href="#home">Inicio</a>
              </li>
              <li>
                <a href="#about">Acerca de</a>
              </li>
              <li>
                <a href="#services">Servicios</a>
              </li>
              <li>
                <a href="#gallery">Galería</a>
              </li>
              <li>
                <a href="#contact">Contacto</a>
              </li>
            </ul>
          </nav>
        </div>
      </header>
    </>
  );
};




export default Navbar;
